import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './components/pages/Home.js';


import './App.css';

function App() {
  return <>
    <BrowserRouter>
      <Switch>
        <Route path='/' component={Home} />

      </Switch>
    </BrowserRouter>
  </>
}

export default App;
